import logo from './logo.svg';
import './App.css';
import Massage from './massage.jsx'; 

const comment = "Hello, dear guest!!!";

function App() {
  return (
    <div className="App">

      <header className="App-header">

        <Massage comment = {comment}/>
      </header>
    </div>
  );
}

export default App;
